import Vue from 'vue';
import App from './App.vue';
import router from './router';
import axios from 'axios';

Vue.config.productionTip = false;

// Set default baseURL for Axios
axios.defaults.baseURL = 'http://localhost:3000/api'; // Change this URL to your backend

new Vue({
  router,
  render: h => h(App)
}).$mount('#app');
